unsigned int {name}(const void* data, unsigned int sz)
{{
    const char* cdata = (const char*)data;
    unsigned int res = 0x811c9dc5;
    unsigned int i = 0;

    while(i < sz)
    {{
        res ^= cdata[i++];
        res *= 0x01000193;
    }}

    return res;
}}

unsigned int {name}(const void* data, unsigned int sz)
{{
    const unsigned char* cdata = (const unsigned char*)data;
    const unsigned int PRIME1 = 0x9E3779B1;
    const unsigned int PRIME2 = 0x85EBCA6B;
    const unsigned int PRIME3 = 0xC2B2AE35;
    const unsigned int PRIME4 = 0x27D4EB2F;
    const unsigned int PRIME5 = 0x165667B1;
    unsigned int res = PRIME5 + sz;
    unsigned int i = 0;

    while(i + 4 <= sz)
    {{
        unsigned int k = ((unsigned int)cdata[i]) | 
                        ((unsigned int)cdata[i+1] << 8) | 
                        ((unsigned int)cdata[i+2] << 16) | 
                        ((unsigned int)cdata[i+3] << 24);
        res += k * PRIME1;
        res = ((res << 13) | (res >> 19)) * PRIME2;
        i += 4;
    }}

    if(i < sz)
    {{
        unsigned int rem = 0;
        while(i < sz)
        {{
            rem = (rem << 8) | cdata[i++];
        }}
        res += rem * PRIME3;
        res = ((res << 13) | (res >> 19)) * PRIME2;
    }}

    res ^= res >> 16;
    res *= PRIME4;
    res ^= res >> 13;
    res *= PRIME1;
    res ^= res >> 16;

    return res;
}}

unsigned int {name}(const void* data, unsigned int sz)
{{
    const unsigned char* cdata = (const unsigned char*)data;
    const unsigned int seed = 0;
    const unsigned int c1 = 0xcc9e2d51;
    const unsigned int c2 = 0x1b873593;
    const unsigned int c3 = 0xe6546b64;
    const unsigned int c4 = 0x85ebca6b;
    const unsigned int c5 = 0xc2b2ae35;
    unsigned int h = seed;
    unsigned int i = 0;

    while(i + 4 <= sz)
    {{
        unsigned int k = ((unsigned int)cdata[i]) | 
                        ((unsigned int)cdata[i+1] << 8) | 
                        ((unsigned int)cdata[i+2] << 16) | 
                        ((unsigned int)cdata[i+3] << 24);
        k *= c1;
        k = (k << 15) | (k >> 17);
        k *= c2;
        h ^= k;
        h = (h << 13) | (h >> 19);
        h = h * 5 + c3;
        i += 4;
    }}

    unsigned int k = 0;
    unsigned int remaining = sz - i;
    if(remaining >= 3)
    {{
        k ^= cdata[i + 2] << 16;
    }}
    if(remaining >= 2)
    {{
        k ^= cdata[i + 1] << 8;
    }}
    if(remaining >= 1)
    {{
        k ^= cdata[i];
        k *= c1;
        k = (k << 15) | (k >> 17);
        k *= c2;
        h ^= k;
    }}

    h ^= sz;
    h ^= h >> 16;
    h *= c4;
    h ^= h >> 13;
    h *= c5;
    h ^= h >> 16;

    return h;
}}
